  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains aircraft navigational
  data obtained during the GRIP campaign (15 Aug 2010 - 30 Sep 2010).  The NASA DC-8
  is outfitted with a navigational recording system which in combination with REVEAL
  provides detailed flight parameters such as airspeed, altitude, roll/pitch/yaw angles,
  ground speed, flight level wind speed, temperature and many others.  The Research
  Environment for Vehicle-Embedded Analysis on Linux (REVEAL) system is a configurable
  embedded system for facilitating integration of instrument payloads with vehicle
  systems and communication links.  REVEAL systems currently serve as onboard data
  acquisition, processing, and recording systems.  NASA has Altair-Class REVEAL systems
  operating on several airborne science platforms, including ER-2, DC-8, WB-57F, P-3B
  Orion and G-III.  This class of full-featured instrument is roughly the size of
  a loaf of bread and weights 10-20 lbs.\",\n\t\"license_title\": \"U.S. Government
